function Home() {
            useEffect(() => {
                fetch("https://covid-19-data.p.rapidapi.com/country/all", {
            "method": "GET",
            "headers": {
                "x-rapidapi-key": "4a9174ccffmshb16b415dc180300p126d7djsnbe79e301cefa",
                "x-rapidapi-host": "covid-19-data.p.rapidapi.com"
            }
        })
        .then(response => {
            console.log(response);
        })
        .catch(err => {
            console.error(err);
        });
            })
    return (
        <div>
            <h1>Hello world</h1>
        </div>
    )
}

export default Home
